INSERT INTO `guitars` VALUES (1,'Acoustic Guitar','https://media.guitarcenter.com/is/image/MMGS7/L59744000001000-00-720x720.jpg','Acoustic, electro-acoustic and classical guitars, from leading brands in world.','An acoustic guitar is a guitar that uses only acoustic (as opposed to electronic) means to transmit the strings vibrational energy to the air in order to produce a sound. This typically involves the use of a sound board and a sound box to amplify the vibrations of the string. The source of sound in an acoustic guitar is the string, which is plucked with the fingers or with a plectrum. The string vibrates at a fundamental frequency but also creates many harmonics at different frequencies. The frequencies produced depend on string length, mass, and tension. The string causes the soundboard and sound box to vibrate, and as these have their own resonances at certain frequencies, they amplify some string harmonics more strongly than others, hence affecting the timbre produced by the instrument.',23.78,'Expensive',0,'2014-06-28','2022-01-18'),(2,'Electric Guitar','https://media.guitarcenter.com/is/image/MMGS7/423791000001000-00-720x720.jpg','Ever-popular solid-body guitars, to hollow-body guitars and archtops.','An electric guitar is a guitar that uses a pickup to convert the vibration of its strings into electrical impulses. The most common guitar pickup uses the principle of direct electromagnetic induction. The signal generated by an electric guitar is too weak to drive a loudspeaker, so it is amplified before sending it to a loudspeaker. Since the output of an electric guitar is an electric signal, the signal may easily be altered using electronic circuits to add color to the sound. Often the signal is modified using effects such as reverb and distortion.',18.34,'Expensive',0,'2014-05-11','2014-05-11'),(3,'Bass Guitar','https://media.guitarcenter.com/is/image/MMGS7/H88873000002000-00-720x720.jpg','Classic Fender Bass, Precision and Jazz basses, to Gibson Thunderbirds.','The bass guitar (also called electric bass,or simply bass) is a stringed instrument played primarily with the fingers or thumb, by plucking, slapping, popping, tapping, thumping, or picking with a plectrum, often known as a pick. The bass guitar is similar in appearance and construction to an electric guitar, but with a longer neck and scale length, and four to six strings or courses. The four-string bass—by far the most common—is usually tuned the same as the double bass, which corresponds to pitches an octave lower than the four lowest pitched strings of a guitar (E, A, D, and G). The bass guitar is a transposing instrument, as it is notated in bass clef an octave higher than it sounds (as is the double bass) to avoid excessive ledger lines. Like the electric guitar, the bass guitar is plugged into an amplifier and speaker for live performances.',35.98,'Cheap',0,'2014-06-12','2014-06-12'),(4,'Violin / Fiddle','https://media.guitarcenter.com/is/image/MMGS7/H73551000005000-00-720x720.jpg','Buynig Violin offers video instruction for beginning and advanced violinists.','The violin, also known as a fiddle, is a string instrument, usually with four strings tuned in perfect fifths. It is the smallest, highest-pitched member of the violin family of string instruments, which also includes the viola, the cello and the double bass. Someone who plays the violin is called a violinist or a fiddler. The violinist produces sound by drawing a bow across one or more strings (which may be stopped by the fingers of the other hand to produce a full range of pitches), by plucking the strings (with either hand), or by a variety of other techniques. The violin is played by musicians in a wide variety of musical genres, including Baroque music, classical, jazz, folk music, rock and roll, and soft rock. The violin has come to be played in many non-Western music cultures all over the world.',20.98,'Expensive',1,'2014-07-01','2014-07-01'),(5,'Platinum Guitar','https://media.guitarcenter.com/is/image/MMGS7/L75548000001000-00-720x720.jpg','Platinum made guitar','Body Body Type | Not Specified Cutaway | Not Specified Top Wood | Not Specified Body Wood Back and Sides | Not Specified Body Bracing Pattern | Not Specified Body Finish | Not Specified Orientation | Not Specified Neck Neck Shape | Not Specified Nut Width | Not Specified Fretboard | Not Specified Neck Wood | Not Specified Scale Length | Not Specified Number of Frets | Not Specified Neck Finish | Not Specified Electronics Acoustic/Electric | Not Specified Other Headstock Overlay | Not Specified Tuning Machines | Not Specified Bridge | Not Specified Saddle and Nut | Not Specified Number of Strings | Not Specified Case | Not Specified Accessories Included | Not Specified Country of Origin | Not Specified',120,'Expensive',0,'2022-01-17','2022-01-18'),(6,'Mandolin','data:image/png;base64,','A mandolin is a stringed musical instrument in the lute family and is generally plucked with a plectrum. It most commonly has four courses of doubled metal strings tuned in unison, thus giving a total of 8 strings, although five and six course versions also exist.','Sporting a gorgeous finish, the Rogue RM-100A is a well-built, traditional A-model mandolin. It features clean workmanship throughout and projects a bright tone with lots of bark. With an easy-to-play neck and adjustable bridge, the RM-100A is perfect for beginners who wish to play bluegrass or any other style of music. Finishing touches include chrome tuners and nickel-plated frets.',56,'Expensive',1,'2022-01-17','2022-01-17'),(7,'Lap Steel Guitar','data:image/png;base64,','The lap steel guitar, also known as a Hawaiian guitar','The lap steel guitar,',75,'Expensive',0,'2022-01-17','2022-01-18');
